import React, {Component} from "react"
import { Link } from 'react-router-dom'

function NavBar(){
    return(
        <div className="nav-bar">
            <Link to="/">Home</Link><br></br>
            <Link to="/comedians">All Comedians</Link>
        </div>
    )
}

export default NavBar
